import React,{useEffect,useState} from 'react';
import './App.css';

export type Play = {

  drive_id        :number  
  ball_possession :string 
  ball_on         :number
  down            :string
  distance        :number
  o_or_k          :string 
  play_type       :string 
  passer          :string 
  reciever        :string
  pass_iscomplete :boolean
  carrier         :string 
  result          :string 
  tackler         :string 
  yards_gained    :number 
  kicker          :string
  punter          :string
  returner        :string
  kick_isgood     :boolean
  kick_result     :string
  return_yards    :number
  yards_recovered :number
}

function App() {

  const [latestPlay,setLatestPlay] = useState<Play>();


  useEffect(() => {
    fetch('http://localhost:9091/plays/latest', {
      method: 'GET'})
    .then(res => res.json())
    .then(data => {
        setLatestPlay(data["Value"])
        console.log("Rendering!")
    })
  },[])


  return (
    <div className="App">
      <p>{latestPlay?.carrier}carried the ball. TD.</p>
    </div>
  );
}

export default App;
